// SPDX-License-Identifier: MIT
pragma solidity >0.5.0 < 0.9.0;

contract loops
{
    uint[3] public arr;
    uint public count;

    function loop() public 
    {
        for(count=0;count<arr.length;count++)
        {
            arr[count]=(count+1)*10;
        }
    }
}

